import React from "react";
import ScrollToTop from "react-scroll-up";
import { FiChevronUp } from "react-icons/fi";
import PageHelmet from "../Helmet/Helmet";
import Breadcrumb from "../BreadCrumb/Breadcrumb";
import Footer from "../Footer/FooterTwo";
import ContactThree from "./ContactThree";

const ContactForm = () => {
  return (
    <>
      <PageHelmet pageTitle="Contact Form" />

      {/* Start Page Wrapper  */}
      <main className="page-wrapper">
        {/* Start Contact Form  */}
        <div className="rn-contact-form-area ptb--120 bg_color--1">
          <ContactThree
            contactTitle="Contact Us"
            contactImages="/assets/images/about/about-6.jpg"
          />
        </div>
        {/* Start Contact Form  */}
      </main>
      {/* End Page Wrapper  */}
    </>
  );
};

export default ContactForm;
